def encrypt_left_shift(input_string, shift_amount):
    encrypted_string = ""
    for char in input_string:
        encrypted_char = chr(ord(char) - shift_amount)  # 左移
        encrypted_string += encrypted_char
    return encrypted_string


def decrypt_left_shift(encrypted_string, shift_amount):
    decrypted_string = ""
    for char in encrypted_string:
        decrypted_char = chr(ord(char) + shift_amount)  # 右移
        decrypted_string += decrypted_char
    return decrypted_string


def encrypt_to_base64(input_string, shift_amount):
    encrypted_string = encrypt_left_shift(input_string, shift_amount)
    encrypted_bytes = encrypted_string.encode('utf-8')
    base64_encoded = base64.b64encode(encrypted_bytes)
    return base64_encoded.decode('utf-8')


def decrypt_from_base64(base64_string, shift_amount):
    decoded_bytes = base64.b64decode(base64_string)
    decoded_string = decoded_bytes.decode('utf-8')
    decrypted_string = decrypt_left_shift(decoded_string, shift_amount)
    return decrypted_string


guest_enc = ""

shift_amount = 3


def rand_account():
    decrypted_string = decrypt_from_base64(guest_enc, shift_amount)
    parts = decrypted_string.split("====")
    account = random.choice(parts).split("@")
    return account[0], account[1]
